import React from "react";
import HeaderClass from "./components/Header";
import Users from "./components/Users";

class AppClass extends React.Component{
    
    render(){
        return(
            <div>
                <HeaderClass title="Cписок пользователей" />
                <main>
                    <Users />
                </main>
                <aside></aside>
            </div>
        )
    }
  
}
export default AppClass;
